  - name: TEXT4000
    number: '6'
    value: This amended report carries forward the corrected opening balance carried
      forward from the previous amended report, which corrects an issue raised by
      the Commission in a Request for Additional Information (RFAI) dated December
      8, 2006.  Additionally, we are now disclosing our administrative expenses on
      Schedule B supporing Line 21(b) to separate these expenses from our contributions
      to non-federal candidates in San Antonio (which is the main mission of the PAC).  This
      report does include several non-federal contributions also inadvertently omitted
      from the original report, but confirmed as written and cleared through our voluntary
      audit.  Poor recordkeeping and report preparation caused the omission and not
      an attempt to conceal election activity.  We have since hired a vendor to assist
      us with reporting services to correct this problem.  Please update your records
      accordingly.
- input: "TEXT\x1CC00396655\x1C1\x1C\x1CSA11AI\x1C\"The amendment also discloses $2,022.50
